import React from "react";
import SingleProduct from "./SingleProduct";

const Products = () => {
  const [products, setProducts] = React.useState([
    { name: "abc", price: 500 },
    { name: "abc1", price: 600 },
  ]);

  return (
    <div>
      <h1>Products</h1>
      {products.map((product, index) => (
        <SingleProduct key={index} product={product} />
      ))}
    </div>
  );
};

export default Products;
